import { Routes, Route, BrowserRouter } from "react-router-dom";
import Navbar from "./components/pages/shared/navbar/Navbar";
import Splash from "./components/pages/splash/Splash";
import SplashLinks from "./components/pages/shared/navbar/links/splash/splash";
import QuestionareSelection from "./components/pages/questionaire-selection/QuestionareSelection";
import Questionnaire from "./components/pages/questionaire/Questionaire";
export default function Main() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Navbar
              childComponent={<Splash />}
              links={<SplashLinks />}
              homeUrl={"/"}
            />
          }
        />
        <Route
          path="/questionaire-selection"
          element={<QuestionareSelection />}
        />
        <Route path="/questionaire/:id" element={<Questionnaire />} />
      </Routes>
    </BrowserRouter>
  );
}
